INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (225,'069','올해의 친절어진 사람을 만나 도움을 받을 것이요 그대를 만나 성공하는 겁으로 가는 곳마다 자신에게 도움을 주는 좋은 사람을 만나게 될 운수입니다. 또한 금년의 운은 좋은 일이 나쁜 일보다 많으므로 대체로 길한 편입니다. 집안에는 조금의 근심과 혹은 실물수가 있어 재물을 잃을 운이 있으나 다행히 그대를 만나 그 도움을 받게 되므로 별로 염려할 것은 없겠습니다. 먼 곳에서 온 사람으로부터 한 번은 놀랄 일이 생깁니다. 그러나 초목이 비를 만남과 같은 복됨이 이어지므로 도처에 기발한 일로 벗이 나겠습니다. 금년 후반기 운은 거듭되던 경사와 후회로 의식이 한가하겠고 부유해진 살림에 근심걱정이 없으나 가족들이 화목하겠습니다. 또한 길한 운세가 끊이지 않고 이어지므로 모든 것이 순조롭고 평탄하겠습니다.','멋은 바람이 부는 곳에서 밝고 찬란한 달빛을 받으며 한가로이 높은 집에 누워 있는 운입니다. 이와 같이 운수가 열려 매사가 순조로우나 욕이 슬피에 있어 혹 근심이 생기기도 하겠습니다. 서방을 조심해야 욕을 면하겠습니다. 만약 이같이 않으면 구설이 따르겠습니다.','진귀한 보물이 펠꽃에 변해 있으니 누가 이를 알겠습니까. 무엇이 자신에게 이득이 되는 줄 모르고 마음만 바쁘게 움직이겠습니다. 집안에는 불안함이 있으며 가족끼리 불화와 재액이 끊이지 않게 될 운수입니다. 그러나 그대의 도움을 만나게 되면 뜻밖의 성공을 거두게 될 것입니다.','구름같이 몰려왔던 욕이 어디론가 사라지고 멋은 하늘 같이 호수가 열리겠습니다. 좋은 일은 있고 흉한 일은 없으니 몸과 마음이 즐거워지고 재물을 모아 낙낙함을 이루겠습니다. 그대가 문에 드는 운이니 사람으로 인해 바라던 일을 이루게 될 것입니다.','공원의 매화가 때를 만나 만발하였습니다. 복됨이 내리는 길한 운세 속에서 꾀하던 일을 바이게 하는 일마다 이득이요 기쁨이 있겠습니다. 만일 이 같지 않으면 남과 다투지 마십시오. 시비할 수 있습니다. 만일 이 같지 않으면 구설에 휩말리게 되겠습니다.','남으로 인해 좋은 일을 얻게 됩니다. 사업을 시행하려면 토지에 좋은 수가 들었으니 그쪽으로 움직여 보십시오. 반드시 재물을 얻고 바라던 것을 이루게 됩니다. 재운이 왕성하므로 경영하는 일은 성공하기 쉬워지고 뜻대로 거두어들이겠습니다.','만일 여자를 만나면 자신에게 도움이 되어지고 바라던 것을 이루겠습니다. 모르던 사람과 더불어 백가지 일에 길함이 있으니 주저하지 말고 의심하지 마십시오. 작은 것을 차곡차곡 쌓아 큰 뜻과 큰 재물을 얻으니 의기가 양양하겠습니다.','그대가 도왔주는 운이므로 다른 사람과 일을 꾀하면 바라던 대로 얻게됩니다. 또한 집안에 새구가 늘겠습니다. 송칠할 수도 있으므로 경사가 생길 기쁜 운수입니다. 물을 조심하십시오. 물가에 가면 후욕이 있으므로 그쪽으로 가는 것은 안가는 것만 못하겠습니다.','길흉이 번번이라 남에게 밀려 은혜로 받은 일이 원수로 뒤바뀌는 상반됨이 있겠습니다. 여자를 조심해야 하겠습니다. 만일 이를 어기고 여색을 가까이 했을 경우 손재는 물론 구설수가 나를 따르겠습니다. 남쪽에 좋은 일이 있으니 그곳으로 가면 이득을 얻겠습니다.','물과 불로 크게 한번 놀랄 운이니 조심해야겠습니다. 자기 것을 잃을 운세가 들었으니 가까운 사람을 조심하십시오. 믿었던 사람으로부터 화를 당하겠습니다. 이 달에는 처음은 좋으나 뒤에는 재액이 있으니 늘 준비하는 마음으로 조심해야 합니다.','곡이 날아지고 암만 무성하니 좋은 일을 성취하기 보다 바뀌었는 일로 인해 고심하겠습니다. 가정을 서로 불평하게 되니 마음에는 불안함 때문에 고통이 따르겠습니다 만일 이 같지 않으면 형제에게 심각한 근심이 생기겠습니다.','용이 드디어 여의치를 얻었으니 욕운이 사라지고 복됨이 돌아오는 조화입니다. 이 달에는 반드시 경사가 있으므로 가정에는 화기가 넘치고 기쁨이 있을 운입니다. 꾀하던 일을 이루고 헛되었던 뜻을 성취하게 되니 마음은 한가롭고 재물 또한 불어나게 될 것입니다.','그대가 나를 따르니 바라던 일을 얻게 되고 멀게만 생각했던 일들도 쉬이 이루어지게 되겠습니다. 남이 넓게 도움을 주려할 때 넓가 일을 바이게 되니 마침 원하던 대로 이루어져 호화하게 될 것입니다. 그러나 가까운 사람을 너무 믿는 것은 좋지 않고 오히려 해가 되겠습니다.','2025-03-02 12:03:58.027897+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (438,'069','我会见您，并获得年度友善者的帮助。此外，今年的运气通常很长，因为它比坏事更好。房子里有一点焦虑和真实的数字，因此您可能会失去财富，但幸运的是，您会遇到您并获得帮助。一个人来自一个遥远的地方，这让人感到惊讶。但是，由于植被与雨水相同，所以我到处都是赤裸裸的。今年下半年的运气将悠闲地意识到已经重复的斜坡和遗憾，并且不必担心富裕的房子，但家庭会和解。此外，漫长的财富还在继续，因此一切都会平稳而平坦。','这是一个运气，它躺在一个在大风的地方带有明亮明亮的月光的高层房子。同样，运输是开放的，因此到处都宣誓就职，但可能令人担忧。小心西方，以免发誓。如果不是这种情况，则将进行结构。','谁知道这一点，因为稀有宝藏变成了pel花？我不知道什么对自己有益，我会忙碌。屋子里有焦虑，家庭将不断地不和谐和重新混合。但是，如果您遇到帮助，您将是意外的。','像云一样蜂拥而至的宣誓就消失了，湖将像天空一样打开。没有什么好，没有什么丑陋的，所以我会享受我的身心并收集财富。您很幸运能在门上，因此您将实现自己想要的东西。','公园的李子露面并盛开。您可以在漫长的财富中可以做的每件事，祝福将是有益和喜悦的。如果不一样，请不要与他人争论。你可以施肥。如果不是一样，您将被扫除。','由于别人，您会得到好东西。要实施您的业务，您拥有大量土地，因此请搬到那里。必须获得并实现。由于运气是有活力的，因此成功并将收获它很容易。','如果您遇到一个女人，我会帮助您并实现您想要的东西。不要毫不犹豫地怀疑与您不认识的人。我将积累小东西，并获得巨大的意义和丰富的财富。','这是您帮助的运气，因此，如果您尝试与他人合作，您将获得想要的东西。此外，新商店将在房屋中增加。可以显示，所以倾向于倾向是一个好运。当心水。如果您去水，您有欲望，所以您不能去那里。','由于吉尔再次是吉尔，因此恩典收到的工作变成了敌人的冲突。小心女人。如果您打破它并接近颜色，您将既关注我和我的手。南方有一件好事，所以如果您去那里，我会受益。','我很惊讶地有很多水和火，所以要小心。要小心亲密的人，因为您有幸失去自己的人。我会和我相信的人生气。本月一开始很不错，但是背后有一个再投资，因此您应该始终小心准备准备。','这首歌正在飞舞，癌症很郁郁葱葱，所以我会挣扎，因为它已经改变而不是实现好东西。一家人会互相抱怨，因此由于焦虑而痛苦。','龙终于获得了Yeochi是一种和谐，因此脏话消失了并受到祝福。这个月必须倾斜，因此家里有很多枪支和欢乐。您将实现自己所做的一切并实现虚荣的含义。','当您关注我时，我会得到我希望的，我认为的事情将完成。当其他人试图提供帮助时，他们将能够工作，以便他们按照自己的意愿完成。但是，相信一个亲密的人是不好的，但这将是有害的。','2025-03-02 12:03:58.027897+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (509,'069','私はあなたに会い、今年の親切な人々の助けを得ます。さらに、今年の運は一般的に長いです。なぜなら、それは悪いことよりも良いからです。家には少し不安と実数があるので、あなたはあなたの富を失うことができますが、幸いなことにあなたはあなたに会い、助けを得るでしょう。遠い場所からの人から驚くべきことがあります。しかし、植生は雨の出会いと同じなので、私はどこでも裸になります。今年の運の後半は、繰り返された斜面と後悔をゆっくりと意識し、裕福な家について心配することはありませんが、家族は和解します。さらに、長所が続くため、すべてが滑らかでフラットになります。','風が強い場所に明るく華麗な月明かりがある高い家に横たわっているのは運です。同様に、交通機関は開いているので、どこでも宣誓されていますが、心配するかもしれません。宣誓を避けるために西に注意してください。そうでない場合、建設が続きます。','珍しい宝物がペルの花に変わっているので、誰がこれを知っていますか？私は自分にとって何が有益であるかわかりません、そして私は忙しく動きます。家には不安があり、家族は絶えず不和と液体になります。しかし、あなたがあなたの助けに会うなら、あなたは予想外になります。','雲のように群がっている宣誓はどこかに消え、湖は空のように開きます。良いものは何もありませんし、醜いものは何もないので、私は自分の体と心を楽しみ、富を集めます。あなたは幸運なことにドアにいるので、あなたが望むものを達成するでしょう。','公園の梅が出会い、満開になりました。祝福が有益で喜びである長い財産でできるそれぞれのこと。それが同じでない場合は、他の人と議論しないでください。あなたは施肥することができます。これが同じでない場合、あなたは一掃されます。','他の人のために、あなたは良いものを手に入れるでしょう。あなたのビジネスを実装するために、あなたはかなりの数の土地を持っているので、そこに移動してください。それを取得して達成する必要があります。運は活発であるため、成功するのは簡単で、それを刈り取ります。','あなたが女性に会ったら、私はあなたを助け、あなたが望むことを達成します。あなたが知らない人に疑うことを躊躇しないでください。私は小さなものを蓄積し、素晴らしい意味と偉大な豊かさを得ます。','それはあなたが助けた運ですので、あなたが他の人と仕事をしようとするなら、あなたはあなたが望むものを手に入れます。さらに、新しい店が家の中で増加します。それは示すことができるので、傾くのは幸運です。水に気をつけてください。あなたが水に行くなら、あなたは欲望を持っているので、あなたはそこに行くことができません。','ギルはもう一度あるので、恵みが受けた仕事が敵に変わったという紛争があります。女性に注意してください。あなたがそれを壊して色に近づくと、あなたは私と私の手に続きます。南には良いことがあるので、そこに行くと利益が得られます。','たくさんの水と火があることにとても驚いているので、注意してください。あなたはあなた自身を失うことができるので、親しい人に注意してください。私は私が信じていた誰かに腹を立てるでしょう。今月は最初は得意ですが、その背後には再投資がありますので、準備には常に注意する必要があります。','歌は飛んでおり、癌は青々としているので、良いことを達成するのではなく変化したので苦労しています。家族はお互いについて不平を言うので、不安のために痛みが続きます。','ドラゴンがついにYeochiを獲得したのは調和であるため、Swearwordは消えて祝福されます。今月は傾斜している必要があるので、家にはたくさんの銃器と喜びがあります。あなたは自分がしたことを達成し、虚栄心の意味を達成します。','あなたが私に従うと、私は私が望んでいたことを手に入れます、そして私が遠くにあったと思ったことは行われるでしょう。他の人が広く助けようとすると、彼らは働くことができるので、彼らは望むように行われます。しかし、親しい人を信じることは良くありませんが、それは有害です。','2025-03-02 12:03:58.027897+00','j');
